import React from 'react';

const Header = () => {
    return (
        <div className='ui fixed menu gray segment' >
            <div className='ui center aligned icon header ' style={{paddingTop:'3px'}}>
                <h2 className='ui purple inverted header' >Contact Management System</h2>
            </div>
        </div>
    );
}
export default Header;
